<!DOCTYPE html>
  <head>
    <meta charset="utf-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <title></title>
    <meta name="description" content="">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <link rel="stylesheet" href="">
  </head>
  <body>
    <script  async defer>
      var stack1 = [], stack2 = []
      function push(node)
      {
          stack1.push(node)
      }
      function pop()
      {
          if (stack2.length == 0) {
              if (stack1.length == 0) {
                  return null
              } else {
                  var length = stack1.length
                  for (var i = 0;i < length; i++) {
                      stack2.push(stack1.pop())
                  }
                  return stack2.pop()
              }
          } else {
              return stack2.pop()
          }
      }
    </script>
  </body>
</html>
